// import './App.css'
import LoginPage from './components/LoginPage';
import FireStationPage from './components/FireStationPage';
import MainStatusPage from './components/MainStatusPage';
import RegisterPage from './components/RegisterPage';
import {Route, Router} from "react-router-dom"


function App() {
  return (
    <Router>
      <Route exact path="/login" component={LoginPage} />
      <Route exact path="/register" component={RegisterPage} />
      <Route exact path="/main" component={MainStatusPage} />
      <Route exact path="/firestation" component={FireStationPage} />
    </Router>
  );
}

export default App;
